import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './styles/index.css';
import { CartProvider } from './context/CartContext';

ReactDOM.render(
  <React.StrictMode>
    <CartProvider>
    <App />
    </CartProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
